cars.description:
Hej  !!! Jag säljer min underbara bil VW Caddy 2.0 STD (diesel), då den inte längre används. Bilen är i gott skick, både invändigt och utvändigt !!! 
     Motor, växellåda, elsystem och AC fungerar perfekt !!! 
     Nybesiktning fram till 2026.11.30 !!! 
     Innan besiktning bytt: 
- Kamaxelsats + vattenpump; 
- Motorolja och oljefilter; 
- Alla filter; 
- Alla stabilisatorer (fram - bak); 
- Generatorrengöringskit; 
- Bromsbelägg (fram + bak); 
- Bromsskivor bak; 
- Styrväxel; 
- Framarmsbussningar; 
- Främre stötdämparlager; 
- Främre navlager (vänster och höger). 
     Bilen har: 
- Vinter- och sommardäck; 
- Servicebok; 
- En nyckel; 
- Motorvärme; 
- Dragkrok. 
     Inbyte erbjuds inte, kontakta endast seriösa köpare !!! Mvh.
